function load_css(href, onload = function() {}) {
	if(document.querySelectorAll('link[href="' + href + '"]').length == 0) {
		var linkTag, head = document.getElementsByTagName('head')[0];
	    linkTag = document.createElement('link');
	    linkTag.rel = "stylesheet";
	    linkTag.href = href;
	    linkTag.onload = onload;
	    head.appendChild(linkTag);
	} else {
		onload();
	}
}

